import styled from "styled-components";

const TeamSectionWrapper = styled.div`
  padding: 85px 0;
  background:#f9faff;

  .alice-carousel__stage-item {
    padding: 4rem !important;
  }


  @media only screen and (max-width: 320px) {
    .wallet-left-content {
      .heading {
        font-size: 25px;
        line-height: 35px;
      }
    }
  }
`;

export default TeamSectionWrapper;
